import React, { useEffect, useState } from 'react';
import {
  Avatar,
  Box,
  Button,
  Card,
  CardHeader,
  IconButton,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Chip,
} from '@mui/material';
import CreateIcon from '@mui/icons-material/Create';
import { Delete } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { getProductRestaurantId } from '../../componet/State/Product/Action';

export default function ProductTable() {
  const dispatch = useDispatch();
  const jwt = localStorage.getItem("jwt");
  const { restaurant, product } = useSelector((store) => store);
  const navigate = useNavigate();

  // State cho trang hiện tại
  const [currentPage, setCurrentPage] = useState(0);
  const [pageSize] = useState(10); // Giả sử 10 sản phẩm mỗi trang

  useEffect(() => {
    dispatch(getProductRestaurantId({
      jwt,
      restaurantId: restaurant.usersRestaurant.id,
      page: currentPage,
      size: pageSize,
    }));
  }, [dispatch, jwt, restaurant.usersRestaurant.id, currentPage, pageSize]);

  // Xử lý thay đổi trang
  const handlePageChange = (page) => {
    if (page >= 0 && page < product.pagination.totalPages) {
      setCurrentPage(page);
    }
  };

  return (
    <Box>
      <Card className='mt-1'>
        <CardHeader
          action={
            <IconButton onClick={() => navigate("/admin/restaurants/add-product")} aria-label="settings">
              <CreateIcon />
            </IconButton>
          }
          title={"Sản phẩm"}
          sx={{ pt: 2, alignItems: "center" }}
        />
        <TableContainer component={Paper}>
          <Table sx={{ minWidth: 650 }} aria-label="simple table">
            <TableHead>
              <TableRow>
                <TableCell align="left">Ảnh</TableCell>
                <TableCell align="right">Tên sản phẩm</TableCell>
                <TableCell align="right">Danh mục cha</TableCell>
                <TableCell align="right">Danh mục con</TableCell>
                <TableCell align="right">Giá</TableCell>
                <TableCell align="right">Trạng thái</TableCell>
                <TableCell align="right">Xóa</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {product.products.map((item) => (
                <TableRow key={item.id} sx={{ '&:last-child td, &:last-child th': { border: 0 } }}>
                  <TableCell component="th" scope="row">
                    <Avatar src={item.images[0]} />
                  </TableCell>
                  <TableCell align="right">{item.name}</TableCell>
                  <TableCell align="right">
                    {item.category ? item.category.name : 'N/A'}
                  </TableCell>
                  <TableCell align="right">
                    {item.categoryItem && item.categoryItem.length > 0 ? (
                      item.categoryItem.map((categoryItem) => (
                        <Chip key={categoryItem.id} label={categoryItem.name} />
                      ))
                    ) : 'N/A'}
                  </TableCell>
                  <TableCell align="right">{item.price} VND</TableCell>
                  <TableCell align="right">
                    <Button
                      variant="contained"
                      style={{ backgroundColor: item.available ? 'green' : 'red' }}
                    >
                      {item.available ? "Còn Hàng" : "Hết Hàng"}
                    </Button>
                  </TableCell>
                  <TableCell align="right">
                    <IconButton color="primary">
                      <Delete />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>

        {/* Phân trang */}
        <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', mt: 2 }}>
          <Button
            onClick={() => handlePageChange(currentPage - 1)}
            disabled={currentPage === 0}
          >
            &lt;
          </Button>
          {Array.from({ length: 3 }, (_, i) => {
            const page = Math.max(0, currentPage - 1) + i;
            return page < product.pagination.totalPages ? (
              <Button
                key={page}
                onClick={() => handlePageChange(page)}
                variant={page === currentPage ? 'contained' : 'outlined'}
              >
                {page + 1}
              </Button>
            ) : null;
          })}
          <Button
            onClick={() => handlePageChange(currentPage + 1)}
            disabled={currentPage + 1 >= product.pagination.totalPages}
          >
            &gt;
          </Button>
        </Box>
      </Card>
    </Box>
  );
}
